import React, { useState, useEffect } from "react";

const slides = [
  { image: "data:image/png;base64,", title: "Up to 30% off", description: "On Every Item" },
  { image: "data:image/png;base64,", title: "Black Friday Sale", description: "Assured discount" },
  // Add more slides here
];

function Carousel() {
  const [currentIndex, setCurrentIndex] = useState(0);

  const nextSlide = () => {
    setCurrentIndex((prevIndex) => (prevIndex + 1) % slides.length);
  };

  const prevSlide = () => {
    setCurrentIndex((prevIndex) => (prevIndex - 1 + slides.length) % slides.length);
  };

  useEffect(() => {
    const autoSlide = setInterval(nextSlide, 7000);
    return () => clearInterval(autoSlide);
  }, []);

  return (
    <div className="carousel relative h-[500px] md:h-[700px] lg:h-[900px] z-0 overflow-hidden bg-[#de8e5f]">
      <div className="relative h-full flex items-center">
        {slides.map((slide, index) => (
          <div
            key={index}
            className={`absolute inset-0 transition-opacity duration-700 ease-in-out ${
              index === currentIndex ? "opacity-100 z-10" : "opacity-0 z-0"
            }`}
            style={{
              backgroundImage: `url(${slide.image})`,
              backgroundSize: "cover",
              backgroundPosition: "center",
              backgroundRepeat: "no-repeat",
            }}
            aria-hidden={index !== currentIndex}
          >
            <div className="absolute top-1/2 transform -translate-y-1/2 w-full px-4 md:px-16">
              <h1 className="text-4xl sm:text-5xl md:text-6xl lg:text-7xl text-center sm:text-left font-bold text-[#ebb54b]">
                {slide.title}
              </h1>
              <p className="text-center sm:text-left text-[#ebb54b] font-bold md:text-lg lg:text-2xl mt-4 mx-4 max-w-md">
                {slide.description}
              </p>
              <div className="mt-4 flex justify-center sm:justify-start">
                <button className="px-6 py-2 bg-[#FCD78C] rounded-[60px] text-white font-bold transition hover:bg-[#ebb54b] hover:text-black text-lg sm:w-[250px] md:w-[300px] lg:w-[350px]">
                  Shop Now
                </button>
              </div>
            </div>
          </div>
        ))}

        {/* Navigation Arrows */}
        
      </div>

      {/* Time Running Animation */}
      <div className="absolute bottom-0 left-0 w-full h-1 bg-[#FCD78C]" style={{ animation: "runningTime 7s linear infinite" }}></div>
    </div>
  );
}

export default Carousel;